import './App.css';

const currentTitle = `The Movie List`;

function SetTitle()
{
    const title = <h1 className="App-title">{currentTitle}</h1>;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {title}
        <a
          className="App-link"
          href="https://themoviedb.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          List API
        </a>
      </header>
      <body className="App-body">

        <div className="Movie-list">

        </div>

      </body>
    </div>
  );
}

export default App;
